///// TRACKING.H
/////
///// This file contains lookup tables (faster than using pow()) for pitch tracking with different
///// tracking stretch factors.  You'll have to identify which stretch factor is appropriate for your GRAINS.
/////
///// The GRAINS IN1, IN2, and IN3 (and Audio In) inputs do not go 0...1023 with 0...5V, but rather
///// they go roughly 0...1300.  This is due, I think, to a voltage divider caused by resistors attached
///// to the inputs.  This means that if you use them for note CV, they track as about 1.3V/Oct rather
///// than 1V/Oct.  This wouldn't be a problem except that the *exact* tracking amount varies as a
///// function of:
/////
///// 1. The supply voltage of your MASTER I/O under load.  It should be 5V but is often slightly off,
/////    you can tune it to exactly 5V if you wished by tweaking the "5V Adj" trimpot.  In case you 
/////    were interested, the "CV Adj" trimpot adjusts the tracking of the CV values produced by 
/////    incoming MIDI notes: while you're in there, you might as well tweak those too and be done 
/////    with it.
/////
///// 2. How warm the resistors are the GRAINS.  This is the important one for our discussion here.
/////    These resistors change their resistance as they warm up, and so the tracking changes.  I
/////    consistently use IN3 for Note CV In.
/////
///// So you need to identify the tracking amount, and use that amount in all my GRAINS projects.  
///// Hopefully you'll only need to do this once, or once in a blue moon.   
/////
///// Below are all the trackings from 40.0 to 50.9.  The default for my machine, when it is warmed up,
///// is around 47.3, though it has a new MASTER I/O that I haven't tuned yet -- with the old MASTER I/O
///// it was around 44.9 warmed up.  To identify your tracking, you'll be tweaking a #define
///// in this program's .ino file.  It looks something like    #define TRACKING_47_3, which means
///// "set tracking to 47.3".  If Grains was a perfect v/oct, this would have been 60 
///// (60 semitones = 5 octaves).  You'll change it to a different value following the instructions
///// in that file.  
/////
///// The following equation converts pitch values into frequencies, with 32.70 (low C) being 0V. 
///// When you include a pitch tuning knob roughly centered, this results in C2
///// (two octaves below middle C).  I might tweak that.
/////
///// The relationship between pitch and frequency is:
///// F = 2^(P / 12) * B
///// Where P is the change in pitch between two notes, B is the frequency of the base note,
///// and F is the frequency of the new note.  We want our pitch to be 0...1023 over 5 octaves
///// but it is not.  To change this we do:
///// F = 2^(P * S / 1023.0 / 12) * B
///// ...where S is some TRACKING STRETCH FACTOR, usually around 45 or so.
///// 
///// In our case I am using B=32.70 (C1) as the base, and we need to identify S.
/////
///// In C, the equation is: float frequency = pow(2.0, pitch * ( 46.9 / 1023.0 / 12.0)) * 32.70;
///// this file contains lookup values so you can just say float frequency = frequencies[pitch].
/////
///// For posterity's sake, I generated the values in this file using the following Common Lisp code:

/*

(dolist (x '(
		400 401 402 403 404 405 406 407 408 409
		410 411 412 413 414 415 416 417 418 419
		420 421 422 423 424 425 426 427 428 429
		430 431 432 433 434 435 436 437 438 439
		440 441 442 443 444 445 446 447 448 449
		450 451 452 453 454 455 456 457 458 459
		460 461 462 463 464 465 466 467 468 469
		470 471 472 473 474 475 476 477 478 479
		480 481 482 483 484 485 486 487 488 489
		490 491 492 493 494 495 496 497 498 499
		500 501 502 503 504 505 506 507 508 509 ))

	(format t "~%~%/// ~a~%#ifdef TRACKING_~a_~a~%PROGMEM const float frequencies[1024+512] = {~%" 
		(/ x 10.0) 
		(floor x 10) 
		(second (multiple-value-list (floor x 10))))
	(dotimes (p (+ 512 1024)) 
		(format t "~a, " (* 32.70 (expt 2.0 (* p (/ x 10) 1/1023 1/12))))
		(when (= 15 (mod p 16)) 
			(terpri)))
	(format t "};~%#endif~%"))

*/





